    authDomain: "tracking-app-3e110.firebaseapp.com",
    projectId: "tracking-app-3e110",
    storageBucket: "tracking-app-3e110.appspot.com",
    messagingSenderId: "926218466602",
    appId: "1:926218466602:web:c67bb8958e7cd187d35a53"
};

const app = initializeApp(firebaseConfig);
export const db = getDatabase(app);
export const auth = getAuth(app);
